import React, { useEffect, useState } from "react"
import { useSelector } from "react-redux"

export const Err = () => {
    const state = useSelector(state => state)

    const [errMessage, changeErrMessage] = useState(state.errMessage)

    useEffect(() => {
        if (state.errMessage != "no err") {
            changeErrMessage(state.errMessage)
        }
        if (state.env[6].value != null) {
            setWhitelist(state.env[6].value.split(","))
        }
        if (state.env[7].value != null) {
            setOpslist(state.env[7].value.split(","))
        }
    }, [state])

    console.log("errMessage: ", errMessage)

    const testErr = () => {
        console.log("testErrFunc")
        return (
            <div className="topMessageTest">
                <span>This is test thingy</span>
            </div>
        )
    }

    switch (errMessage) {
        case !"no err":
            return testErr();
        default:
            return null;
    }
}
